import React, { useState } from 'react';
import { Link } from 'react-scroll';
import './Navbar.css'; // Ensure your CSS file path is correct

const Navbar = () => {
  const [collapsed, setCollapsed] = useState(true); // State to manage navbar collapse

  const toggleNavbar = () => {
    setCollapsed(!collapsed);
  };

  return (
    <nav className={`navbar ${collapsed ? 'collapsed' : ''}`}>
      <div className="navbar-toggle" onClick={toggleNavbar}>
        <span></span>
        <span></span>
        <span></span>
      </div>
      <ul className={`nav-links ${collapsed ? 'collapsed' : ''}`}>
        <li><Link to="aboutMe" smooth={true} duration={500} onClick={toggleNavbar}>About Me</Link></li>
        <li><Link to="qualifications" smooth={true} duration={500} onClick={toggleNavbar}>My Qualifications</Link></li>
        <li><Link to="journey" smooth={true} duration={500} onClick={toggleNavbar}>My Journey</Link></li>
        <li><Link to="projects" smooth={true} duration={500} onClick={toggleNavbar}>Projects</Link></li>
        <li><Link to="hobbies" smooth={true} duration={500} onClick={toggleNavbar}>Hobbies</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
